import PropTypes from "prop-types";
import Book from "./book"

const BookShelf = ({title, books}) => {

    return (


            <div>
                <h1>{title}</h1>

                <ol>
                    {books.map((book) => (
                    <Book
                        author={book.author}
                        title={book.title}
                        image={book.image}
                    />
                    ))}
                </ol>
            </div>

    );
};

BookShelf.propTypes = {
    title: PropTypes.string.isRequired,
    books: PropTypes.array.isRequired
  };

export default BookShelf;
